import React from 'react'
import { NavLink } from 'react-router-dom'

const NavBar = () => {
  return (
    <>
      <NavLink to="/login" style={{marginRight: "20px"}}>Login</NavLink>
      <NavLink to="/register" style={{marginRight: "20px"}}>Register</NavLink>
      <NavLink></NavLink>
    </>
  )
}

export default NavBar
